Descrição:

Organização de Atividades de rotina de COA;
Emitir e conferir os relatórios de produtividade agrícola da colheita, plantio, tratamento de semente e outros;
Emitir relatórios do monitoramento do radar meteorológico para contribuir para tomada de decisão agrícola;
Analisar dados e elaborar relatórios baseados nos indicadores de desempenho.
